column8:
アームの全長を変更するのではなく、独自のボールショイント一体式アジャスターを装着し、キャンバー角を増加させる画期的なアイテム。従来のアーム長を調整するタイプではストローク時のキャンバー変化量が左右異なり、アッパーアームおよびロアアームの位置関係が狂うのに対し、MF-Rキャンバーアジャスターはこれらのステアリング特性に悪影響を及ぼすネガティブな要素を排除。  <br><br>スポーツ走行およびサーキット走行に適した2種類のキャンバー設定値を用意し、あらゆる走行ステージに対応します。同時にローダウン時のロールセンターを補正する革新的な機能も搭載。理想的なキャンバー設定とロールセンター補正機能の融合がタイヤのグリップ力を極限まで高め、未体験のコーナリング性能を実現します。<br><br>●保安基準適合品 ●新開発ボールジョイント採用 ●ボルトオン設計 ●ジュラルミン合金製 ●ダストブーツ標準装備 ●キャンバー増加量：-0°30～-0°50 ●当製品を装着することによりトレッド幅が変化しますのでホイールオフセットにご注意ください。 <br><br>対応車種：BNR34 GT-R <br><br>　車検対応品<br><br>足回り/ロールセンターアダプター<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


